import React from 'react';

const Services = () => {
  const services = [
    {
      title: "System Architecture",
      shortDesc: "Scalable & secure system design",
      icon: "üèóÔ∏è",
      features: ["Microservices", "Cloud Native", "High Availability"]
    },
    {
      title: "Web & Mobile Dev",
      shortDesc: "Full-stack applications",
      icon: "üì±",
      features: ["React", "React Native", "Responsive"]
    },
    {
      title: "API Development",
      shortDesc: "REST & GraphQL APIs",
      icon: "üîå",
      features: ["Documentation", "Integration", "Security"]
    },
    {
      title: "Security Auditing",
      shortDesc: "Security assessments",
      icon: "üõ°Ô∏è",
      features: ["Pen Testing", "Best Practices", "Hardening"]
    },
    {
      title: "Deployment & DevOps",
      shortDesc: "CI/CD & Cloud setup",
      icon: "üöÄ",
      features: ["Docker", "AWS", "Automation"]
    },
    {
      title: "Performance Optimization",
      shortDesc: "Speed & efficiency",
      icon: "‚ö°",
      features: ["Database Tuning", "Caching", "Monitoring"]
    }
  ];

  return (
    <section id="services" className="py-10 md:py-14 bg-white">
      <div className="max-w-6xl mx-auto px-4 sm:px-6">
        {/* Compact Header */}
        <div className="text-center mb-10">
          <h2 className="text-2xl md:text-3xl font-bold text-tech-blue mb-3">
            <span className="gradient-text">Services</span>
          </h2>
          <div className="w-16 h-1 bg-gradient-to-r from-tech-cyan to-tech-green mx-auto mb-4"></div>
          <p className="text-gray-600 text-sm md:text-base max-w-2xl mx-auto">
            End-to-end solutions for modern systems
          </p>
        </div>

        {/* Compact Grid */}
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-4 md:gap-6">
          {services.map((service, index) => (
            <div 
              key={index}
              className="group bg-gray-50 rounded-xl p-5 border border-gray-200 hover:border-tech-cyan/30 hover:shadow-md transition-all duration-300 hover:scale-[1.02]"
            >
              {/* Icon & Title Row */}
              <div className="flex items-start gap-4 mb-3">
                <div className="flex-shrink-0 w-12 h-12 flex items-center justify-center bg-gradient-to-br from-tech-cyan/10 to-tech-green/10 rounded-lg group-hover:scale-110 transition-transform duration-300">
                  <span className="text-2xl">{service.icon}</span>
                </div>
                <div>
                  <h3 className="text-base md:text-lg font-bold text-tech-blue group-hover:text-tech-cyan transition-colors">
                    {service.title}
                  </h3>
                  <p className="text-sm text-gray-500 mt-1">
                    {service.shortDesc}
                  </p>
                </div>
              </div>

              {/* Features Tags */}
              <div className="flex flex-wrap gap-1.5 mb-4">
                {service.features.map((feature, idx) => (
                  <span 
                    key={idx}
                    className="px-2 py-1 bg-tech-blue/5 text-tech-blue text-xs rounded-md"
                  >
                    {feature}
                  </span>
                ))}
              </div>

              {/* Action Button */}
              <button className="w-full py-2 text-sm font-medium text-tech-cyan hover:text-tech-blue border border-tech-cyan/30 rounded-lg hover:bg-tech-cyan/10 transition-all duration-300 flex items-center justify-center gap-1 group/btn">
                <span>Details</span>
                <span className="group-hover/btn:translate-x-1 transition-transform">‚Üí</span>
              </button>
            </div>
          ))}
        </div>

        {/* Stats Row */}
        <div className="mt-10 grid grid-cols-2 md:grid-cols-4 gap-4">
          {[
            { number: "50+", label: "Projects" },
            { number: "100%", label: "Success Rate" },
            { number: "24/7", label: "Support" },
            { number: "5+", label: "Years Exp" }
          ].map((stat, index) => (
            <div 
              key={index}
              className="text-center p-4 bg-gradient-to-br from-white to-gray-50 rounded-lg border border-gray-200"
            >
              <div className="text-xl md:text-2xl font-bold text-tech-cyan mb-1">
                {stat.number}
              </div>
              <div className="text-xs md:text-sm text-gray-600">
                {stat.label}
              </div>
            </div>
          ))}
        </div>

        {/* CTA */}
        <div className="mt-10 text-center">
          <button className="px-6 py-3 bg-gradient-to-r from-tech-cyan to-tech-green text-white font-medium rounded-lg hover:shadow-lg transition-all duration-300">
            View All Services ‚Üí
          </button>
        </div>
      </div>
    </section>
  );
};

export default Services;
